import React from "react";
import {
  Navbar,
  Nav,
} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

class NavBar extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Navbar fixed="top" className="portfolioNavbar" expand="md">
        <Navbar.Brand className="navbarText" to="/">
          Stephen Doyle
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav>
            <Nav.Link className="navbarText" to="/about">
              About
            </Nav.Link>
            <Nav.Link className="navbarText" to="/about">
              Projects
            </Nav.Link>
            <Nav.Link className="navbarText" to="/about">
              Articles
            </Nav.Link>
            <Nav.Link className="navbarText" to="/about">
              Resources
            </Nav.Link>
            <Nav.Link className="navbarText" to="/about">
              Contact
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default NavBar;
